import React from "react";
import GoogleMapReact from 'google-map-react';
import "./Main.css";  

function GoogleMapsAPI(props) { 

  const {curentLocation} = props;

  return (
    <React.Fragment>
      <div class = "box">
        <GoogleMapsReact
          defaultCenter = {curentLocation.center}

        />
      </div>
    </React.Fragment>
  )
}


export default GoogleMapsAPI;
